window.bookSummaryJSON = "<p>The world is at war and the prophesied savior is nowhere to be found. The Witcher, Geralt of Rivia, races to find her in the fourth novel of Andrzej Sapkowski's groundbreaking epic fantasy series that inspired the hit Netflix show and the blockbuster video games.</p> <p>The world has fallen into war. Ciri, the child of prophecy, has vanished. Hunted by friends and foes alike, she has taken on the guise of a petty bandit and lives free for the first time in her life.</p> <p>But the net around her is closing. Geralt, the Witcher, has assembled a group of allies including Dandelion, Milva, Regis, and Cahir, to rescue her. Both sides of the war have sent brutal mercenaries to hunt her down. Her crimes have made her famous.</p> <p>There is only one place left to run. The tower of the swallow is waiting...</p> <p>Witcher collections:</p> <p></p> <ul> <li><i>The Last Wish</i></li> <li><i>Sword of Destiny</i></li> </ul> <p>Witcher novels:</p> <p></p> <ul> <li><i>Blood of Elves</i></li> <li><i>The Time of Contempt</i></li> <li><i>Baptism of Fire</i></li> <li><i>The Tower of Swallows</i></li> <li><i>Lady of the Lake</i></li> <li><i>Season of Storms</i></li> </ul> <p>Hussite Trilogy:</p> <p></p> <ul> <li><i>The Tower of Fools</i></li> <li><i>Warriors of God</i></li> </ul> <p>Translated from original Polish by David French.</p>"; 
